function show_hide() {
  var x = document.getElementById("layer-1");
  if (x.style.visibility === "hidden") {
    x.style.visibility = "visible";
    x.style.opacity = "1";
  } else if (x.style.visibility === "visible") {
    x.style.opacity = "0";
    x.style.visibility = "hidden";
  }
};

function show_hide_2() {
  var x = document.getElementById("layer-2");
  if (x.style.visibility === "hidden") {
    x.style.visibility = "visible";
    x.style.opacity = "1";
  } else if (x.style.visibility === "visible") {
    x.style.opacity = "0";
    x.style.visibility = "hidden";
  }
};

function show_hide_3() {
  var x = document.getElementById("layer-3");
  if (x.style.visibility === "hidden") {
    x.style.visibility = "visible";
    x.style.opacity = "1";
  } else if (x.style.visibility === "visible") {
    x.style.opacity = "0";
    x.style.visibility = "hidden";
  }
  else {
    x.style.opacity = "0";
    x.style.visibility = "hidden";
  }
};

function show_4() {
  var x = document.getElementById("layer-4");
  if (x.style.visibility === "hidden") {
    x.style.visibility = "visible";
    x.style.opacity = "1";
  }
};

function hide_4() {
  var x = document.getElementById("layer-4");
  if (x.style.visibility === "visible") {
    x.style.opacity = "0";
    x.style.visibility = "hidden";
  }
};

function toggle_seen_map() {
  var x = document.getElementById("button-map");
  var y = document.getElementById("button-grid");

  y.classList.remove("clicked")
  x.classList.add("clicked")

}

function toggle_seen_grid() {
  var x = document.getElementById("button-map");
  var y = document.getElementById("button-grid");

  x.classList.remove("clicked")
  y.classList.add("clicked")

}

</script>
